import { BrowserRouter, Routes, Route } from 'react-router-dom'

// Pages and Components
import Display from './pages/Display'

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <div className="pages">
          <Routes>
            <Route 
              path='/'
              element={<Display />}
            />
          </Routes>
        </div>
      </BrowserRouter>
    </div>
  );
}

export default App;
